function Month(): string
{
    switch (date("m")) {
        case 1 : $month = "Янв"; break;
        case 2 : $month = "Фев"; break;
        case 3 : $month = "Март"; break;
        case 4 : $month = "Апр"; break;
        case 5 : $month = "Май"; break;
        case 6 : $month = "Июнь"; break;
        case 7 : $month = "Июль"; break;
        case 8 : $month = "Авг"; break;
        case 9 : $month = "Сен"; break;
        case 10 : $month = "Окт"; break;
        case 11 : $month = "Ноя"; break;
        case 12 : $month = "Дек"; break;
        default : $month = ""; break;
    }
    return $month;
}

function Water($id)
{
    // Инициализация cURL
    $curl = curl_init();

    // Настройка параметров cURL
    curl_setopt_array($curl, array(
        CURLOPT_URL => "https://static.uz/api/water/daily?id={$id}&limit=1", // Используем & вместо &&
        CURLOPT_RETURNTRANSFER => true,
        CURLOPT_ENCODING => '',
        CURLOPT_MAXREDIRS => 10,
        CURLOPT_TIMEOUT => 0,
        CURLOPT_FOLLOWLOCATION => true,
        CURLOPT_HTTP_VERSION => CURL_HTTP_VERSION_1_1,
        CURLOPT_CUSTOMREQUEST => 'GET',
    ));

    // Выполнение запроса
    $response = curl_exec($curl);

    // Проверка на ошибки cURL
    if (curl_errno($curl)) {
        echo "cURL Error: " . curl_error($curl);
        curl_close($curl);
        return null;
    }

    // Закрытие соединения
    curl_close($curl);

    // Декодирование JSON в ассоциативный массив
    $data = json_decode($response, true);

    // Проверка на успешное декодирование
    if (json_last_error() !== JSON_ERROR_NONE) {
        echo "JSON Decode Error: " . json_last_error_msg();
        return null;
    }

    // Возвращаем данные
    return $data;
}

