<script>
    am5.ready(function() {
        // Создаем корневой элемент графика
        // https://www.amcharts.com/docs/v5/getting-started/#Root_element
        var root = am5.Root.new("chartdiv2");

        // Устанавливаем тему
        root.setThemes([
            am5themes_Animated.new(root)
        ]);

        // Создаем график
        var chart = root.container.children.push(am5xy.XYChart.new(root, {
            panX: true,
            panY: true,
            wheelX: "panX",
            wheelY: "zoomX",
            pinchZoomX: true,
            paddingLeft: 0,
            paddingRight: 1
        }));

        // Добавляем курсор
        var cursor = chart.set("cursor", am5xy.XYCursor.new(root, {}));
        cursor.lineY.set("visible", false); // Скрываем вертикальную линию курсора

        // Данные (время в часах и соответствующие значения)
        var data = <?= $maps->GesYesterdayHour($organizations) ?>;

        // Находим первую максимальную и первую минимальную точки
        var maxValue = Math.max(...data.map(item => item.value));
        var minValue = Math.min(...data.map(item => item.value));

        var maxPoint = data.find(item => item.value === maxValue);
        var minPoint = data.find(item => item.value === minValue);

        // Создаем категориальную ось X (время в часах)
        var xAxis = chart.xAxes.push(am5xy.CategoryAxis.new(root, {
            categoryField: "hour", // Поле данных для категорий
            renderer: am5xy.AxisRendererX.new(root, {
                minGridDistance: 80,
                minorGridEnabled: true,
                stroke: am5.color(0xffffff), // Цвет линии оси X
                strokeWidth: 2, // Толщина линии оси X
                labels: {
                    fill: am5.color(0xffffff) // Цвет меток оси X
                },
                grid: {
                    stroke: am5.color(0xffffff), // Цвет сетки оси X
                    strokeWidth: 1
                }
            })
        }));

        xAxis.get("renderer").labels.template.setAll({
            fill: am5.color("#ffffff"), // Цвет текста на оси Y
            fontSize: 12               // Размер шрифта
        });

        // Передаем данные в ось X
        xAxis.data.setAll(data);

        // Создаем числовую ось Y (значения)
        var yAxis = chart.yAxes.push(am5xy.ValueAxis.new(root, {
            maxDeviation: 1,
            renderer: am5xy.AxisRendererY.new(root, {
                stroke: am5.color(0xffffff), // Цвет линии оси Y
                strokeWidth: 2, // Толщина линии оси Y
                labels: {
                    fill: am5.color(0xffffff) // Цвет меток оси Y
                },
                grid: {
                    stroke: am5.color(0xffffff), // Цвет сетки оси Y
                    strokeWidth: 1
                }
            })
        }));

        yAxis.get("renderer").labels.template.setAll({
            fill: am5.color("#ffffff"), // Цвет текста на оси Y
            fontSize: 12               // Размер шрифта
        });

        // Добавляем серию данных
        var series = chart.series.push(am5xy.SmoothedXLineSeries.new(root, {
            name: "<?= date("Y-m-d", strtotime("yesterday")) ?>",//"Series",
            xAxis: xAxis,
            yAxis: yAxis,
            valueYField: "value", // Поле данных для значений
            categoryXField: "hour", // Поле данных для категорий
            tooltip: am5.Tooltip.new(root, {
                labelText: "{hour} : {valueY} МВт",
            })
        }));

        // Заполняем серию данными
        series.data.setAll(data);

        // Добавляем заливку под линией
        series.fills.template.setAll({
            visible: true, // Включаем видимость заливки
            fillOpacity: 1, // Полная непрозрачность заливки
            fill: am5.color(0xff0000) // Красный цвет заливки
        });

        // Выделяем одну максимальную и одну минимальную точки
        series.bullets.push(function (root, series, dataItem) {
            var hour = dataItem.get("categoryX");
            var value = dataItem.get("valueY");

            if ((hour === maxPoint.hour && value === maxPoint.value) ||
                (hour === minPoint.hour && value === minPoint.value)) {
                // Создаем контейнер для маркера и текста
                var bullet = am5.Container.new(root, {});

                // Добавляем маркер (круг)
                var circle = bullet.children.push(am5.Circle.new(root, {
                    radius: 5, // Больший радиус для выделения
                    stroke: am5.color(0xffffff), // Белая обводка
                    strokeWidth: 2,
                    fill: value === maxPoint.value ? am5.color(0x00ff00) : am5.color(0xff0000) // Зеленый для максимума, красный для минимума
                }));

                // Добавляем текстовую метку
                var labelText = value ;//=== maxPoint.value ? "Max" : "Min";
                var label = bullet.children.push(am5.Label.new(root, {
                    text: labelText, // Текст метки
                    fill: am5.color(0xffffff), // Цвет текста (белый)
                    fontSize: 12, // Размер шрифта
                    centerX: am5.p50, // Горизонтальное выравнивание
                    centerY: am5.p100, // Вертикальное выравнивание
                    // dy: -15 // Смещение метки вверх относительно маркера
                }));

                return am5.Bullet.new(root, {
                    sprite: bullet
                });
            }
            return null; // Для остальных точек не добавляем маркеры
        });

        // Добавляем легенду
        var legend = chart.children.push(am5.Legend.new(root, {
            centerX: am5.percent(100), // Центрируем легенду по горизонтали
            x: am5.percent(100),
            y: 0,
            layout: root.horizontalLayout, // Горизонтальное расположение элементов легенды
        }));

        // Настройка стилей текста легенды
        legend.labels.template.setAll({
            fill: am5.color(0xffffff), // Белый цвет текста
            fontSize: 14, // Размер шрифта
            text: "<?= date("Y-m-d", strtotime("yesterday")) ?> кундаги қувват мониторинги" // Пользовательский текст для легенды
        });

        // Отключаем автоматическое заполнение данных легенды
        legend.data.setAll([{ name: "<?= date("Y-m-d", strtotime("yesterday")) ?> кундаги қувват мониторинги", fill: am5.color(0x00ff00) }]);

        // Анимация при загрузке
        series.appear(1000);
        chart.appear(1000, 100);

        var rootQwerty = am5.Root.new("chartdiv123");

// Set themes
        rootQwerty.setThemes([
            am5themes_Animated.new(rootQwerty)
        ]);

// Create chart
        var chartQwerty = rootQwerty.container.children.push(am5xy.XYChart.new(rootQwerty, {
            panX: false,
            panY: false,
            wheelX: "none",
            wheelY: "none",
            layout: rootQwerty.verticalLayout,
            paddingLeft: 0
        }));

// Data
        var dataQwerty = <?= $maps->GesAggregate($organizations, 10) ?>;

// Populate data
        for (var i = 0; i < (dataQwerty.length - 1); i++) {
            dataQwerty[i].valueNext = dataQwerty[i + 1].value;
        }

// Create axes
        var xRendererQwerty = am5xy.AxisRendererX.new(rootQwerty, {
            cellStartLocation: 0.1,
            cellEndLocation: 0.9,
            minGridDistance: 30,
            minorGridEnabled: true
        });

        var xAxisQwerty = chartQwerty.xAxes.push(am5xy.CategoryAxis.new(rootQwerty, {
            categoryField: "year",
            renderer: xRendererQwerty,
            tooltip: am5.Tooltip.new(rootQwerty, {}),
        }));

        xAxisQwerty.get("renderer").labels.template.setAll({
            fill: "#fff", // Красный цвет
            fontSize: 12, // Размер шрифта
            rotation: -90, // Поворот текста на 45 градусов против часовой стрелки
