        legendQwerty.data.setAll([{ name: "10 кунлик ишлаб чиқариш мониторинги", fill: am5.color(0x00ff00) }]);

        // Make stuff animate on load
        seriesQwerty.appear();
        seriesQwerty2.appear();
        chartQwerty.appear(1000, 100);

        function getVariancePercent(dataItem) {
            if (dataItem) {
                var value = dataItem.get("valueY");
                var openValue = dataItem.get("openValueY");
                var change = value - openValue;
                return Math.round(change / openValue * 100);
            }
            return 0;
        }

    }); // end am5.ready()
</script>

