                await new Promise(resolve => setTimeout(resolve, 3000)); // Ждем 5 секунд перед повторным запросом
                return getQashqadarya(); // Рекурсивный вызов
            }
            console.log("Қуйи Бўзсув ГЭСлар каскади");
        } catch (error) {
            createNotification('Қуйи Бўзсув ГЭСлар каскади билан алоқа узилган!', 'alert-subtle-danger', 3000);
            await new Promise(resolve => setTimeout(resolve, 3000)); // Ждем 5 секунд перед повторным запросом
            return getQuyibuzsuv(); // Рекурсивный вызов
        } finally {
            clearTimeout(timeoutId); // Очищаем таймаут
        }

    }
    //Оҳангарон ГЭС
    async function getOhangaron() {
        const controller = new AbortController();
        const timeoutId = setTimeout(() => controller.abort(), 60000); // Таймаут 60 секунд

        try {
            const response = await fetch('/oxangaron/server', { signal: controller.signal });

            if (!response.ok) {
                createNotification('Оҳангарон ГЭС билан алоқа узилган!', 'alert-subtle-danger', 3000);
                await new Promise(resolve => setTimeout(resolve, 3000)); // Ждем 5 секунд перед повторным запросом
                return getOhangaron(); // Рекурсивный вызов
            }

            const text = await response.text(); // Получаем ответ как текст
            const data = JSON.parse(text); // Парсим JSON строку
            console.log('Parsed data:', data);
            let trueAgg= 0; let falseAgg = 0; let errorAgg = 0;
            data.forEach(item => {
                if (item.id === 1) {
                    const value = document.getElementById("activeoxan");
                    value.textContent = formatNumber(item.value, 2, ',', ' ').replace("-", "") + " МВт";
                    activePower += item.value;
                } else if (item.id === 2) {
                    reactivePower += item.value;
                } else if (item.id === 3) {
                    activeOut += item.value;
                } else if (item.id === 4) {
                    activeIn += item.value;
                } else if (item.id === 5) {
                    ownNeeds += item.value;
                } else if (item.id === 7) {
                    const value = document.getElementById("trueoxan");
                    value.textContent = item.value;
                    aggTrue += item.value;
                    trueAgg = item.value;
                } else if (item.id === 8) {
                    const value = document.getElementById("falseoxan");
                    value.textContent = item.value;
                    aggFalse += item.value;
                    falseAgg = item.value;
                } else if (item.id === 9) {
                    const value = document.getElementById("erroroxan");
                    value.textContent = item.value;
                    aggError += item.value;
                    errorAgg = item.value;
                }
            });
            const valueAll = document.getElementById("alloxan");
            valueAll.textContent = trueAgg + falseAgg + errorAgg;

            if ((trueAgg + falseAgg + errorAgg) === 0) {
                createNotification('Оҳангарон ГЭС билан алоқа узилган!', 'alert-subtle-danger', 3000);
                await new Promise(resolve => setTimeout(resolve, 3000)); // Ждем 5 секунд перед повторным запросом
                return getQashqadarya(); // Рекурсивный вызов
            }
            console.log("Оҳангарон ГЭС");
        } catch (error) {
            createNotification('Оҳангарон ГЭС билан алоқа узилган!', 'alert-subtle-danger', 3000);
            await new Promise(resolve => setTimeout(resolve, 3000)); // Ждем 5 секунд перед повторным запросом
            return getOhangaron(); // Рекурсивный вызов
        } finally {
            clearTimeout(timeoutId); // Очищаем таймаут
        }
    }

    document.addEventListener('DOMContentLoaded', function () {
        getUrtachirchiq();getChirchiq();getQodiriya(); getQuyibuzsuv();getOhangaron();
    });

    function getPower() {
        const valuePower = document.getElementById("active-power");
        valuePower.innerHTML = formatNumber(this.activePower, 2, ',', ' ').replace("-", "");

        const reactivePower = document.getElementById("reactive-power");
        reactivePower.innerHTML = formatNumber(this.reactivePower, 2, ',', ' ').replace("-", "");

        const activeOut = document.getElementById("activeOut");
        activeOut.innerHTML = formatNumber(this.activeOut, 2, ',', ' ').replace("-", "");

        const activeIn = document.getElementById("activeIn");
        activeIn.innerHTML = formatNumber(this.activeIn, 2, ',', ' ').replace("-", "");

        const ownNeeds = document.getElementById("ownNeeds");
        ownNeeds.innerHTML = formatNumber(this.ownNeeds / 1000, 2, ',', ' ').replace("-", "");
    }

    function getAgg() {
        const aggTrue = document.getElementById("true");
        aggTrue.innerHTML = this.aggTrue;
        const aggFalse = document.getElementById("false");
        aggFalse.innerHTML = this.aggFalse;
        const aggError = document.getElementById("error");
        aggError.innerHTML = this.aggError;
    }

    setInterval(getPower, 2000);
    setInterval(getAgg, 2000);

    // Сохраняем данные перед обновлением
    window.addEventListener('beforeunload', function () {
        localStorage.setItem('savedData', JSON.stringify({ key: 'value' }));
    });

    // Восстанавливаем данные после загрузки страницы
    window.addEventListener('load', function () {
        const savedData = localStorage.getItem('savedData');
        if (savedData) {
            const data = JSON.parse(savedData);
            console.log('Восстановленные данные:', data);
        }
    });
</script>